limerick_list.text:
John is twenty and Marsha's thirteen;
Their relationship's causing a scene.
They agree it's commutual;
That prob'ly won't suit you all.
They consent but the jury looks mean.

Dumped my girl. I prefer my computer;
Got a virus because I pursued her.
But that woman came back
Though I gave her a NAK;
So I guess I'll just have to reboot her.

Mow the lawn, wax the car, sweep the floors;
Milk the cow, get supplies from the stores;
Groom the dog, wash the dishes,
Toss food to the fishes.
It's sad, but I've had all these chores.

Blite's an herb; blight is ruin, disease;
Blighty's "home" to Brit troops overseas;
There are blighters (guys; lugs);
Seems a blightbird eats bugs;
And when blithe, one feels light as a breeze.
